sys_variable_value.value:
(function execute(inputs, outputs) {
    var utils = new x_759224_magic_c_0.symbology_utils();
    var body = JSON.parse(inputs.response);
    var nBody = body.data[0]; // get the first card object

    // if (nBody.legalities) {
    //     nBody.legalities = utils.formatLegalities(nBody.legalities);
    // }

    // Convert oracle text symbols to image tags
    if (nBody.card_faces && Array.isArray(nBody.card_faces)) {
        if (nBody.card_faces[0] && typeof nBody.card_faces[0].oracle_text === 'string') {
            nBody.card_faces[0].oracle_text = utils.convertSymbolsToImages(nBody.card_faces[0].oracle_text); // Convert Face One Oracle Text to Symbols
        }

        if (nBody.card_faces[0] && typeof nBody.card_faces[0].mana_cost === 'string'){
            nBody.card_faces[0].mana_cost = utils.convertSymbolsToImages(nBody.card_faces[0].mana_cost); // Convert Face One Mana Cost to Symbols
        }

        if (nBody.card_faces[1] && typeof nBody.card_faces[1].oracle_text === 'string') {
            nBody.card_faces[1].oracle_text = utils.convertSymbolsToImages(nBody.card_faces[1].oracle_text);
        }

        if (nBody.card_faces[1] && typeof nBody.card_faces[1].mana_cost === 'string') {
            nBody.card_faces[1].mana_cost = utils.convertSymbolsToImages(nBody.card_faces[1].mana_cost);
        }

    } else if (typeof nBody.oracle_text === 'string' && typeof nBody.mana_cost === 'string') {
        // If it's a single-faced card
        nBody.oracle_text = utils.convertSymbolsToImages(nBody.oracle_text);
        nBody.mana_cost = utils.convertSymbolsToImages(nBody.mana_cost);
    }

    if (nBody.image_uris || nBody.card_faces) {
        nBody.image_uris = utils.convertImageUrisToHtml(nBody);
    }

    // Set the modified card object as the new response
    outputs.new_response = nBody;
})(inputs, outputs);

